/*** General style & theming ***/
.rass-container {
/*
        height: 1%;
*/
	display            : block;
	box-sizing         : border-box;

	width              : 100%;
	min-width          : 310px;
	max-width          : 480px;
	margin             : auto;
	padding            : 12px;

	-webkit-box-sizing : border-box;
}

