	font-size     : 1.7rem;
	font-weight   : normal;
	color         : #000099;
	line-height   : 1.9rem;
	
}

.rass-page-title .rass-ui-logo {
	position : absolute;
	top      : 3px;
	right    : 4px;

	width    : 49px;
}

.rass-layout-center .rass-page-title {
	padding-right: 0;
}

.rass-layout-center .rass-page-title p {
	color: #333;
	margin:0;
	padding-top: 4px;
	padding-bottom: 4px;
