.rass-layout-center .rass-page-title span {
	width: 100%;
	display: block;
	text-align: center;
	padding-bottom: 40px;
	padding-top: 0.5em;
}

.rass-page-title p {
	padding-top: 4px;
	padding-bottom: 4px;
}

.rass-page-title .rass-profile-avatar {
	height: 90px;
}

.rass-section-action {
        /*
        margin-top: 2em;
        */
}

.rass-section-input ul, .rass-section-input ul li {
	margin-left : 10px;
