.rass-section-action .rass-button-primary:active {
    background: #CC5200;
    border-color: #CC5200;
}

.rass-section-action .rass-button-tertiary:active {
    background: #EEEEEE;
    border-color: #999999;
}


.rass-section-action .rass-button-primary {
	-webkit-box-sizing: border-box;
	-moz-box-sizing: border-box;
	box-sizing: border-box;

	display			 : block;
	text-align		 :center;
	min-width		 : 120px;
	width            : 100%;
	margin-bottom    : 1em;
	padding          : 8px 16px;

	background-color : #F60;
	font-size        : 1.2rem;
	color            : #FFF;
	border           : 1px solid #F60;
	border-radius    : 6px/20px;


}

.rass-pagewrapper input[type="submit"]:focus,
.rass-pagewrapper input[type="checkbox"]:focus{
	outline-style: solid !important;
	outline-width: 2pt !important;
	outline-color: -moz-mac-focusring !important;
	outline-offset:0;
}

.rass-section-action .rass-button-secondary {
	-webkit-box-sizing: border-box;
	-moz-box-sizing: border-box;
	box-sizing: border-box;

	width            : 100%;
	margin-bottom    : 1em;
	padding          : 8px 16px;

	background-color : #F7F7F7;
	font-size        : 1.2rem;
	color            : #666;
	border           : 1px solid #AAA;
	border-radius    : 6px/20px;
}

.rass-section-action .rass-button-tertiary {
	display       : block;

	-webkit-box-sizing: border-box;
	-moz-box-sizing: border-box;
	box-sizing: border-box;

	background: none;
	width         : 100%;
	margin-bottom : 0.5em;

	font-size     : 1.2rem;
	color         : #009;
	text-align    : left;
	border        : none;

	margin-left: 4px;
}

