.rass-container a.rass-default-link {
	display       : inline-block;

	height        : 26px;
	margin-bottom : 0.5em;
	margin-left   : 4px;
	padding-left  : 35px;

	background    : /*savepage-url=images/icon-link-26px.png*/ url() center left no-repeat;
	line-height   : 26px;
}

.rass-container a.rass-plain-link {
	display       : inline-block;

	margin-bottom : 1em;
	margin-left: 0;
	padding-left: 4px;

}

.rass-container a.rass-plain-link-inline {
	display       : inline-block;
	margin-left: 0;
	padding-left: 0px;
