}


.rass-container .rass-ui-phonenumber {
	font-size : 1.2rem;
}

/* error message */
.rass-ui-error, .rass-ui-servererror {
	display            : block;
	clear              : both;
	box-sizing         : border-box;

	min-height         : 1.9em;
	width              : 100%;
	margin-top         : 0.4em;
	padding-left       : 16px;

	font-size          : 0.9rem;
	font-style         : normal;
	font-weight        : normal;
	color              : red;

	-webkit-box-sizing : border-box;
	-moz-box-sizing    : border-box;
}

.rass-container .rass-ui-servererror {
	
	min-height:0;

}

.rass-section-error {
	padding : 8px 0 30px 0;
	color   : red;
}

.rass-state-svrerror {
	margin-bottom : 1em;
	margin-left   : 4px;

	color         : red;
}

