/*** RASS States ***/

.rass-container .rass-state-disabled,
.rass-container .rass-state-disabled .wrap,
.rass-container .rass-state-disabled.rass-state-active .wrap,
.rass-container .rass-section-input .rass-state-disabled label,
.rass-container .rass-section-input .rass-state-disabled input,

.rass-container .rass-section-input label.rass-state-disabled input,
.rass-container .rass-section-input .rass-state-disabled.rass-state-active input,
.rass-container .rass-section-input label.rass-state-disabled input:focus {
	color:#D8D8D8;
	border-bottom-color:#D8D8D8;
	border-width: 1px;
}


.rass-section-input .rass-state-disabled label {
	border-color:#D8D8D8;
}



/*** swaplist states ***/
.rass-page-dposign .rass-section-input ul {
	list-style: none;
}


.rass-page-dposign .rass-section-input ul li {
	text-indent:0;
	position: relative;
}

.rass-page-dposign .rass-section-input ul li::before {
	content:'\2022';
	position: absolute;
	top: 0;
	left: -1em;
	width: 1em;
	height: 1em;
	font-size: 1em;
}

.rass-page-dposign .rass-section-input ul li:last-child {
	position: static;
}

.rass-page-dposign .rass-section-input ul li:last-child::before {
	display: none;
}

ul.rass-ui-swaplist li:first-child {
	display:block;
	cursor:pointer;
	padding-right: 1.2em;
	margin-left: -6px;
}

ul.rass-ui-swaplist li:last-child {
	display:block;
	margin-left: 0;
}

ul.rass-ui-swaplist li:first-child::before, ul.rass-ui-swaplist li:last-child::before {
	display: none;
}

/* closed */
.rass-state-swapclosed li {
	display:none;
	position: relative;
}

.rass-state-swapclosed li:first-child::after {
	content:'+';
	position: absolute;
	color:#009;
	top: -1px;
	right: 0;
	width: 0.6em;
	height: 1em;
	font-size: 2rem;
}

.rass-state-swapclosed li:first-child:hover::after {
	color:#F60;
}	

/* opened */
